  \"2016-07-27T22:19:17.815754\",\n\t\"name\": \"san-francisco-bay-national-wildlife-refuge-predator-management-plan-and-final-environmenta\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service has
  prepared an environmental assessment to evaluate the effects associated with the
  implementation of a predator  management program on the San Francisco Bay National
  Wildlife Refuge. The U.S. Fish and Wildlife Service proposes, in conjunction with
  existing habitat acquisition and wetland restoration programs, to Implement a predator
  management program to reduce the number of selected predators and increase the density
  and production of endangered species and colonial nesting waterbirds in the San
  Francisco Bay National Wildlife Refuge. Management efforts include a small scale
  program to install predator barriers, trapping and shooting in localized areas.
  The target predators are rats, alien (non-native) red fox, raccoons, feral cats,
  and skunks.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
